const canvas = document.getElementById('preview');
const fileInput = document.getElementById('asciiFileInput');
const asciiImage = document.getElementById('ascii');
const context = canvas.getContext('2d');
const toGrayScale = (r, g, b) => 0.21 * r + 0.72 * g + 0.07 * b;
const getFontRatio = () => {
    const pre = document.createElement('pre');
    pre.style.display = 'inline';
    pre.textContent = ' ';
    document.body.appendChild(pre);
    const { width, height } = pre.getBoundingClientRect();
    document.body.removeChild(pre);
    return height / width;
};
const fontRatio = getFontRatio();
const convertToGrayScales = (context, width, height) => {
    const imageData = context.getImageData(0, 0, width, height);
    const grayScales = [];
    for (let i = 0 ; i < imageData.data.length ; i += 4) {
        const r = imageData.data[i];
        const g = imageData.data[i + 1];
        const b = imageData.data[i + 2];
        const grayScale = toGrayScale(r, g, b);
        imageData.data[i] = imageData.data[i + 1] = imageData.data[i + 2] = grayScale;
        grayScales.push(grayScale);
    }
    context.putImageData(imageData, 0, 0);
    return grayScales;
};
const clampDimensions = (width, height) => {
	var MAXIMUM_WIDTH = Number($("#imageMaxWidth").val());
	var MAXIMUM_HEIGHT = MAXIMUM_WIDTH;
    const rectifiedWidth = Math.floor(getFontRatio() * width);
    if (height > MAXIMUM_HEIGHT) {
        const reducedWidth = Math.floor(rectifiedWidth * MAXIMUM_HEIGHT / height);
        return [reducedWidth, MAXIMUM_HEIGHT];
    }
    if (width > MAXIMUM_WIDTH) {
        const reducedHeight = Math.floor(height * MAXIMUM_WIDTH / rectifiedWidth);
        return [MAXIMUM_WIDTH, reducedHeight];
    }
    return [rectifiedWidth, height];
};

fileInput.onchange = (e) => {
    file = e.target.files[0];
	updateImageFile();
};
const grayRamp = '█▓▒░ ';
const getCharacterForGrayScale = grayScale => $("#grayRamp").val()[Math.ceil(($("#grayRamp").val().length - 1) * grayScale / 255)];
const drawAscii = (grayScales, width) => {
    const ascii = grayScales.reduce((asciiImage, grayScale, index) => {
        let nextChars = getCharacterForGrayScale(grayScale);
        if ((index + 1) % width === 0) {
            nextChars += '\n';
        }
        return asciiImage + nextChars;
    }, '');
    asciiImage.textContent = ascii;

	if (canvasIsEmpty == 1) {
		$("#paintResult").val($("#ascii").text());
		sendToCanvas($("#paintResult").val());
	}
};
function updateImageFile() {
    const reader = new FileReader();
    reader.onload = (event) => {
        const image = new Image();
        image.onload = () => {
            const [width, height] = clampDimensions(image.width, image.height);
            canvas.width = width;
            canvas.height = height;
            context.drawImage(image, 0, 0, width, height);
            const grayScales = convertToGrayScales(context, width, height);
            //fileInput.style.display = 'none';
			$("#imagePreOptions").fadeIn(333);
            drawAscii(grayScales, width);
        }
        image.src = event.target.result;
    };
    reader.readAsDataURL(file);
}
var file;
String.prototype.replaceAll = function(search, replacement) {
    var target = this;
    return target.split(search).join(replacement);
};


function textConvertedToUnicode(str) {
	var out = "";
	for (i = 0; i < [...str].length; i++) {
		out += parseInt("0x" + toUni([...str][i])) + ",";
	}
	return out;
}
